import './App.css';
import axios from 'axios';
import { useState } from 'react';
import { createBrowserRouter } from 'react-router-dom';

function App() {
  const [text, setText] = useState('');


  axios.get('http://localhost:8888/').then((res) => {setText(res.json())}).catch((e) => {console.log('여기?')});

  return (
    <div className="App">
      {text}
    </div>
  );
}

export default App;
